  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from then               U.S. Census Bureau's Master Address File / Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB).  The
  MTDB representsn               a seamless national file with no overlaps or gaps
  between parts, however, each TIGER/Line shapefile is designed to stand alone as
  an independent datan               set, or they can be combined to cover the entire
  nation.nn               Census Blocks are statistical areas bounded on all sides
  by visible features, such as streets, roads, streams, and railroad tracks, and/or
  by nonvisiblen               boundaries such as city, town, township, and county
  limits, and short line-of-sight extensions of streets and roads.  Census blocks
  are relatively smalln               in area; for example, a block in a city bounded
  by streets.  However, census blocks in remote areas are often large and irregular
  and may even be manyn               square miles in area.  A common misunderstanding
  is that data users think census blocks are used geographically to build all other
  census geographicn               areas, rather all other census geographic areas
  are updated and then used as the primary constraints, along with roads and water
  features, to delineaten               the tabulation blocks.  As a result, all 2010
  Census blocks nest within every other 2010 Census geographic area, so that Census
  Bureau statistical datan               can be tabulated at the block level and aggregated
  up to the appropriate geographic areas.  Census blocks cover all territory in the
  United States,n               Puerto Rico, and the Island Areas (American Samoa,
  Guam, the Commonwealth of the Northern Mariana Islands, and the U.S. Virgin Islands).
  \ Blocks are then               smallest geographic areas for which the Census Bureau
  publishes data from the decennial census.  A block may consist of one or more faces.
